@autocurry
def bulk_update(queryset, **kwargs):
    queryset.update(**kwargs)
    return queryset
assert bulk_update(included=True)({'counter': 5}) == {'counter': 5,
    'included': True}
assert bulk_update(included=True)({'counter': 5}, **{'included': False}) == {
    'counter': 5, 'included': False}
